import React from "react"
import MainPage from "./MainPage"
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App(){
    return(
        <div>
           < BrowserRouter>
           <Routes>
            <Route path="/">{< MainPage /> }</Route>
           </Routes>
           </BrowserRouter>
        </div>
    )
}

export default App
